 function createStripedDetails(){
 	var counter=0;
 	$('.details-table li, .personal-link li').each(function(){
 			counter++;
 			if (counter%2==1)
 				$(this).addClass('odd');
 			else
 				$(this).addClass('even');
 				
 	});
 }

 function getContrastYIQHex(hexcolor){
 	var hexcolor = hexcolor.replace("#", "");
 	return getContrastYIQ(hexcolor);
 }

 function getContrastYIQ(hexcolor){
 	//taken from https://24ways.org/2010/calculating-color-contrast/
	var r = parseInt(hexcolor.substr(0,2),16);
	var g = parseInt(hexcolor.substr(2,2),16);
	var b = parseInt(hexcolor.substr(4,2),16);
	var yiq = ((r*299)+(g*587)+(b*114))/1000;
	return (yiq >= 128) ? 'black' : 'white';
}


function renderPageInitFunc(){
	resizeInit();
	createStripedDetails();
	adjustTitleClasses();
	addDomClasses();

	//Card resized we can now display it.
	$('.main').css('visibility','visible');
	$('.main').css('opacity',1);


	$('.vcard-collapse-item').on('click',function(){
		setTimeout(function(){ currentHeight = updateViewHeight(); }, 400);
	});

	$('.trigger-share-modal').on('click',function(){
		$('.share-icon-wrap').show();
		if ($(document).height() > $(window).height()) {
            var scrollTop = ($('html').scrollTop()) ? $('html').scrollTop() : $('body').scrollTop(); // Works for Chrome, Firefox, IE...
			$('body').addClass('modal-shown').css('top',-scrollTop);
		} else {
			$('body').addClass('modal-shown');
		}


		$('.share-icon-wrap .close').on('click',function(){
			$('.share-icon-wrap').hide();	
			$('body').removeClass('modal-shown');
		});
	});

	//fix address height issue on new designs
	$('.personal-link li').last().addClass('last');
	fixAddressNeighborHeight();

	$('.personal-link li').each(function(){
		fixIconHeight(this);
	});

	
	// $('.vcard-collapse-item__trigger.save').on('click',function(){
	// 	//Lazy load the instructions image.
	// 	instrcImg = $('.save.vcard-collapse-item__contentOuter').find('img');
	// 	saveSrc = instrcImg.attr('data-src');
	// 	instrcImg.attr('src',saveSrc);
	// 	instrcImg.css('visibility','visible');
	// 	instrcImg.css('opacity','1');
	// });

 	//Hide Desktop Actions if Empty

 	var ActionsEmpty = true; //flag
 	$('.card-actions .vcard-collapse-item').each(function(){
 		if (!$(this).hasClass('share') && !$(this).hasClass('vcf')) {
 		   if (!$(this).hasClass('hidden')) {
 			  //alert('boo');
 			  // console.log($(this));
 			  ActionsEmpty = false;
 		   }
 		}
 	});

 	if (ActionsEmpty) {
 		$('.card-actions').hide();
 		//$('.desktop-socials').addClass('first');
 	}

 	//Hide Empty Socials
 	DesktopSocials = $('.desktop-socials .social-icons');
 	if (!DesktopSocials.length) {
 		$('.desktop-socials').hide();
 	}

 	AboutAction = $('.card-actions .about.vcard-collapse-item .accordion-toggle');
 	GalleryAction = $('.card-actions .gallery.vcard-collapse-item .accordion-toggle');
 	VideoAction = $('.card-actions .videos.vcard-collapse-item .accordion-toggle');
 	if (AboutAction.length > 0 && !isMobile) {
 		$(AboutAction).trigger('click');
 	} else if (GalleryAction.length > 0 && !isMobile) {
 		$(GalleryAction).trigger('click');
 	} else if (VideoAction.length > 0 && !isMobile) {
 		$(VideoAction).trigger('click');
 	}

 	//Android Share Fix
 	//remove _blank attribute from Whatsapp link for Android Only
	var ua = navigator.userAgent.toLowerCase();
	var isAndroid = ua.indexOf("android") > -1;
	if(isAndroid) {
	  $('.share-item .wa_btn').removeAttr('target');
	}

}

function updateViewHeight() {
		
		//console.log('Win Width: '+winWidth);
		// console.log('updateViewHeight');
		var $container = $('.vcard-container');
		var $wrapper = $('#card-wrapper');
		//winWidth = $(window).width();
		if ($wrapper.width() < 800) {
			var scale = $wrapper.width() / 800;
		} else {
			scale = 1;
		}

		$(".main").css('height','auto');
		$container.css('height','auto');
		$wrapper.css('height','auto');

		var updatedHeight = $(".main").outerHeight();

		//Set Updated height according to design (800px)
		//$container.css('overflow','auto');
		$(".main").height(updatedHeight);
		$wrapper.height(updatedHeight);
		// console.log(updatedHeight*scale);
		$container.height(updatedHeight*scale);
		//$container.css('overflow','hidden');
		if ($wrapper.width() < 800) {
			//fix margin offset on mobile devices
			fixMainVerticalOffset($(".main"));
		}
		// console.log(updatedHeight);
		return updatedHeight;
}

function fixMainVerticalOffset($el){
	  //contHeight = $container.height();
	  var $wrapper = $('#card-wrapper');
	  elHeight = $el.height();
	  scale = $wrapper.width() / 800;
	  StarterHeight = $wrapper.outerHeight();
	  margeTopDiff = (elHeight-StarterHeight*scale)/2;
	  $el.css('margin-top','-'+margeTopDiff+'px');
}


function iOSVersion() {
  var match = (navigator.appVersion).match(/OS (\d+)_(\d+)_?(\d+)?/),
		version = [
			parseInt(match[1], 10),
			parseInt(match[2], 10),
			parseInt(match[3] || 0, 10)
		];

	return parseFloat(version.join('.'));
}

function adjustTitleClasses(){
	//adjust title sizes for tech and advanced designs.
	var titleHeight = $(".col-1 .title h1").height();
	if (titleHeight > 65)
		$(".col-1 .title h1").parent().addClass('shrink');

	var personalTitleHeight = $(".main.personal .col-1 .title h1").height();
	if (personalTitleHeight > 80)
		$(".main.personal .col-1 .title h1").parent().addClass('personal-shrink');


}

function addDomClasses() {
	
	//add class for long titles
	var titleHeight = $(".col-1 .title h1").height();
	//alert(titleHeight);
	if (titleHeight > 85) {
		$(".col-1 .title h1").parent().addClass('two-lines');
		$(".sharecircle").addClass('two-lines');
	}

	$(".advanced .details-link li").each(function(){
		advDetailsBlockHeight = $(this).height();
		console.log(advDetailsBlockHeight);
		if (advDetailsBlockHeight > 180) {
			$(this).addClass('large');
		} else if (advDetailsBlockHeight > 140) {
			$(this).addClass('medium');
		}

	});

	var addressHeight = $(".col-1 #address").height();
	//alert(addressHeight); //143
	if (addressHeight > 150)
		$(".col-1 #address").addClass('two-lines');

	$(".col-1 .clink").each(function(){
		var clinkHeight = $(this).height();
		if (clinkHeight > 150)
			$(this).addClass('two-lines');
		else
			$(this).removeClass('two-lines');
	});
}


function fixAddressNeighborHeight() {
 //only effect topaz and pearl designs
 if (!$('body').hasClass('topaz') && !$('body').hasClass('pearl'))
 	return;

 var addrEl = $('li#address');
 if (addrEl.hasClass('last') && addrEl.hasClass('odd'))
 	return;

 //define sibling first.
 if (addrEl.hasClass('odd'))
 	addrSibling = addrEl.next();
 else if (addrEl.hasClass('even'))
 	addrSibling = addrEl.prev();
 else
 	return;

 //special case for alternative social icons
 if (addrSibling.hasClass('alternative-social-display'))
 	addrSibling = addrSibling.children(":first");
 
 //console.log ('addrSibling');
 //console.log(addrSibling);

 console.log('addrEl.height(): ' +addrEl.height());
 console.log("addrEl.find('div').first().height(): "+addrEl.find('div').first().height());

 if (addrEl.height() > addrSibling.height()) {
 	if (addrSibling.find('a').length) {
 		addrSibling.find('a').height(addrEl.children(":first").height());
 	} else {
 		addrSibling.find('div').first().height(addrEl.children(":first").height());
 	}
 	fixIconHeight(addrEl);
 	fixIconHeight(addrSibling);
 	fixLabelHeight(addrSibling);
 } else {
 	return;
 }

}


function fixIconHeight(el) {
	//console.log(($(el).height() ));
	if ($(el).height() > 160) {
		$(el).find('.resources').css('marginTop',($(el).height()/2 - 76) + 'px');
		$(el).find('.resources').css('marginBottom',($(el).height()/2 - 76) + 'px');
	} else {
		$(el).find('.resources').css('marginTop','inherit');
		$(el).find('.resources').css('marginBottom','inherit');		
	}
}

function fixLabelHeight(el) {
	//console.log('el.height(): '+el.height());
	if (el.parent().hasClass('alternative-social-display')) {
		//special case for alternative social icon display
		$(el).find('.titleres').css('marginTop',(el.height()/2 - 68) + 'px');
		return;
	}

	$(el).find('.titleres').css('marginTop',(el.height()/2 - 76) + 'px');
	if ($(el).hasClass('clink'))
		$(el).find('.linkres').css('marginTop',(el.height()/2 - 76) + 'px');
}
