$(document).on('ready page:load', function () {
	renderPageInitFunc();

	// $(".content").mCustomScrollbar();


	$( '.swipebox' ).swipebox({
		// OPTIONS...
		// useCSS : true, // false will force the use of jQuery for animations
		// initialIndexOnArray: 0, // which image index to init when a array is passed
		// removeBarsOnMobile : true, // false will show top navigation bar on mobile devices
		// hideCloseButtonOnMobile : false, // true will hide the close button on mobile devices
		// removeBarsOnMobile : true, // false will show bottom bar on mobile devices
		// hideBarsDelay : 3000, // delay before hiding bars on desktop
		// videoMaxWidth : 1140, // videos max width
		// beforeOpen: function(){} , // called before opening
		// afterOpen: null, // called after opening
		// afterClose: function(){}, // called after closing
		// afterMedia: function(){}, // called after media is loaded
		// loopAtEnd: false, // true will return to the first image after the last image is reached
		// autoplayVideos: false // true will autoplay Youtube and Vimeo videos
		// queryStringData: {} // plain object with custom query string arguments to pass/override for video URLs,
		// toggleClassOnLoad: '' // CSS class that can be toggled when the slide will be loaded (like 'hidden' of Bootstrap)
		// useSVG: true

	  afterOpen: function(){
	  	// Script to fix issue with Gallery Slidebox Close button triggering click on close
        var $selectorClose = $("#swipebox-close");
        var clickAction = "touchend click";

        $selectorClose.unbind(clickAction);

        $selectorClose.bind(clickAction, function(event){
          event.preventDefault();
          event.stopPropagation();

          $.swipebox.close();
        });
      }
	});


	var swiper = new Swiper('.swiper-container', {
	    // Optional parameters
	    loop: true,
	    autoplay: 4500,
	    	    
	    // Navigation arrows
	    nextButton: '.swiper-button-next',
	    prevButton: '.swiper-button-prev',


	    pagination: '.swiper-pagination',
	    paginationClickable: true
	});
	
});

function statEventWasMade(id, type) {
	console.log(id, type)	
	var statType;	
	switch(type) {
    case 1:
        statType = 'share_whatsapp'
        break;
    case 2:
        statType = 'share_sms'
        break;
    case 3:
        statType = 'share_email'
        break;
    case 4:
        statType = 'share_fb'
        break;
    case 5:
    	statType = 'click_to_email'
    	break;
    case 6:
		statType = 'click_to_sms'
		break;
	case 7:
		statType = 'click_to_website'
		break;
	case 8:
		statType = 'click_to_call'
		break;
	case 9:
		statType = 'click_to_waze'
		break;
	case 10:
		statType = 'click_to_save_vcf'
		break;
	case 11:
		statType = 'footer_option_a'
		break;
	case 12:
		statType = 'footer_option_b'
		break;
	case 13:
		statType = 'share_telegram'
		break;
    default:
    	statType = ''
        break;
	}

	$.post("/statEvent/".concat(statType), {
         card_id: id,
    }, function(data) {
         var output = data.result;
    });

}
;
